USE Assignment


CREATE TABLE Jomato(
   OrderId         INTEGER  NOT NULL PRIMARY KEY 
  ,RestaurantName  VARCHAR(160) NOT NULL
  ,RestaurantType  VARCHAR(29) NOT NULL
  ,Rating          NUMERIC(3,1)
  ,NoofRating      INTEGER  NOT NULL
  ,AverageCost     INTEGER 
  ,OnlineOrder     VARCHAR(3) NOT NULL
  ,TableBooking    VARCHAR(3) NOT NULL
  ,CuisinesType    VARCHAR(83) NOT NULL
  ,Area            VARCHAR(30) NOT NULL
  ,LocalAddress    VARCHAR(29) NOT NULL
  ,"Delivery time" INTEGER  NOT NULL
);
